const projectTable = [
    {
        title: 'Job',
        dataIndex: 'job',
        render: (text) => <a>{text}</a>,
    },
    {
        title: 'Project name',
        dataIndex: 'project_name',
    },
    {
        title: 'Created by',
        dataIndex: 'created_by',
    },
    {
        title: 'Created date',
        dataIndex: 'created_date',
    },
    {
        title: 'Created time',
        dataIndex: 'created_at',
    },
]

const TableHeadersUtil = {
    projectTable
}

export default TableHeadersUtil;
